{
  "name": "UBX-NAV-STATUS",
  "class_id": "0x01",
  "message_id": "0x03",
  "description": "Receiver navigation status",
  "message_type": "periodic_polled",
  "payload_length": {
    "fixed": 16
  },
  "fields": [
    {
      "byte_offset": 0,
      "name": "iTOW",
      "data_type": "U4",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
    },
    {
      "byte_offset": 4,
      "name": "gpsFix",
      "data_type": "U1",
      "description": "GPSfix Type, this value does not qualify a fix as valid and within the limits. See note on flag gpsFixOk below. 0x00 = no fix 0x01 = dead reckoning only 0x02 = 2D-fix 0x03 = 3D-fix 0x04 = GPS + dead reckoning combined 0x05 = Time only fix 0x06..0xff = reserved"
    },
    {
      "byte_offset": 5,
      "name": "flags",
      "data_type": "X1",
      "description": "Navigation Status Flags",
      "bitfields": [
        {
          "bit_offset": 0,
          "bit_length": 1,
          "name": "gpsFixOk",
          "data_type": "U1",
          "description": "1 = position and velocity valid and within DOP and ACC Masks."
        },
        {
          "bit_offset": 1,
          "bit_length": 1,
          "name": "diffSoln",
          "data_type": "U1",
          "description": "1 = differential corrections were applied"
        },
        {
          "bit_offset": 2,
          "bit_length": 1,
          "name": "wknSet",
          "data_type": "U1",
          "description": "1 = Week Number valid (see section Time validity in the integration manual for details)"
        },
        {
          "bit_offset": 3,
          "bit_length": 1,
          "name": "towSet",
          "data_type": "U1",
          "description": "1 = Time of Week valid (see section Time validity in the integration manual for details)"
        },
        {
          "bit_offset": 4,
          "bit_length": 4,
          "name": "reserved0",
          "data_type": "X4",
          "reserved": true
        }
      ]
    },
    {
      "byte_offset": 6,
      "name": "fixStat",
      "data_type": "X1",
      "description": "Fix Status Information",
      "bitfields": [
        {
          "bit_offset": 0,
          "bit_length": 1,
          "name": "diffCorr",
          "data_type": "U1",
          "description": "1 = differential corrections available"
        },
        {
          "bit_offset": 1,
          "bit_length": 1,
          "name": "carrSolnValid",
          "data_type": "U1",
          "description": "1 = valid carrSoln"
        },
        {
          "bit_offset": 2,
          "bit_length": 4,
          "name": "reserved0",
          "data_type": "X4",
          "reserved": true
        },
        {
          "bit_offset": 6,
          "bit_length": 2,
          "name": "mapMatching",
          "data_type": "U2",
          "description": "map matching status: 00: none 01: valid but not used, i.e. map matching data was received, but was too old 10: valid and used, map matching data was applied"
        }
      ]
    },
    {
      "byte_offset": 7,
      "name": "flags2",
      "data_type": "X1",
      "description": "further information about navigation output",
      "bitfields": [
        {
          "bit_offset": 0,
          "bit_length": 2,
          "name": "psmState",
          "data_type": "U2",
          "description": "power save mode state (not supported for protocol versions less than 13.01) 0 = ACQUISITION [or when psm disabled] 1 = TRACKING 2 = POWER OPTIMIZED TRACKING 3 = INACTIVE"
        },
        {
          "bit_offset": 2,
          "bit_length": 1,
          "name": "reserved0",
          "data_type": "X1",
          "reserved": true
        },
        {
          "bit_offset": 3,
          "bit_length": 2,
          "name": "spoofDetState",
          "data_type": "U2",
          "description": "Spoofing detection state (not supported for protocol versions less than 18.00) 0: Unknown or deactivated 1: No spoofing indicated 2: Spoofing indicated 3: Multiple spoofing indications"
        },
        {
          "bit_offset": 5,
          "bit_length": 1,
          "name": "reserved1",
          "data_type": "X1",
          "reserved": true
        },
        {
          "bit_offset": 6,
          "bit_length": 2,
          "name": "carrSoln",
          "data_type": "U2",
          "description": "Carrier phase range solution status: 0 = no carrier phase range solution 1 = carrier phase range solution with floating ambiguities 2 = carrier phase range solution with fixed ambiguities"
        }
      ]
    },
    {
      "byte_offset": 8,
      "name": "ttff",
      "data_type": "U4",
      "unit": "ms",
      "description": "Time to first fix (millisecond time tag)"
    },
    {
      "byte_offset": 12,
      "name": "msss",
      "data_type": "U4",
      "unit": "ms",
      "description": "Milliseconds since Startup / Reset"
    }
  ]
}
